import PatientNavBar from '../Components/PatientNavBar'
import { useParams } from 'react-router-dom';
import React, { useState, useEffect } from 'react';

function PatientAppointment() {
    let {id}=useParams();
    const [doctors,setDoctors]=useState([
        {
            doctorId:1,
            doctorName:"Sachin",
            specialist:"Ent",
            hopitalId:2,
        },
        {
            doctorId:2,
            doctorName:"Vinoth",
            specialist:"MD",
            hopitalId:1,
        },
        {
            doctorId:3,
            doctorName:"Mattu",
            specialist:"Heart",
            hopitalId:2,
        }
    ]);
    // useEffect(()=>{

    // },[])
  return (
    <>
        <PatientNavBar/>
        <div>{
              doctors.filter(doctor=>doctor.hospitalId===id).map((doc)=>
               <div className='doc'>
                <h3>
                    {doc.doctorId}
                </h3>
                      <h3>
                          {doc.doctorName}
                      </h3>
                      <h3>
                          {doc.specialist}
                      </h3>
                </div>
              )
            }
        </div>



    </>
  )
}

export default PatientAppointment
